import React from 'react';
import { Link } from 'react-router-dom';

const Menu = () => {
    return (
        <div>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/Lecture">Lecture</Link></li>
            </ul>
            <hr/>
        </div>
    );
};

export default Menu;
